    "vip-guide-6ed9a",nt"isopen": true,nt"url": null,nt"notes": "VIP
    is the follow-on framework from PMAS for the development and management of IT projects
    which will propel the Department with even more rigor toward Veteran-focused delivery
    of IT capabilities. The VIP framework unifies and streamlines IT delivery oversight
    and will deliver IT products more efficiently, securely and predictably. The VIP
    framework creates an environment delivering more frequent releases through a deeper
    application of Agile practices. In parallel with a single integrated release process,
    VIP will increase cross-organizational and business stakeholder engagement, provide
    greater visibility into projects, increase Agile adoption and institute a predictive
    delivery cadence.",nt"license_title": "U.S. Government Work",nt"extras":
